import React from "react";
import "./styles.scss"

export function Homepage()  {
    return(
        <div>
            <h1 className="heading">Electric Cars, Solar & Energy</h1>
            <button className="btn">ALL CARS</button>
            <img src="./brand.svg" className="brand-logo" alt="brand logo"/>
        </div>
    );
}
